import React from "react";

const Navbar = ({ cookie, cookieValue, handleLogin, handleLogout }) => {
    const userId = cookie ? cookie.get('UserId') : null;
    const userFullName = cookie ? `${cookie.get('UserFN')} ${cookie.get('UserLN')}` : '';

    return (
        <nav className="row navbar px-5 shadow-sm bg-body-tertiary fixed-top">
            <div className="container-fluid">
                <a className="navbar-brand" href="/"><img style={{width: 8 + 'em'}} src="/Images/logoBlack.png" alt="Logo"/></a>
                <div className="row justify-content-end">
                    <div className="col-auto">
                        <button type="button" className="btn text-decoration-none btn-light">Host on Comfy Rental</button>
                    </div>
                    <div className="col-auto">
                        <div className="dropdown-center">
                            <button style={{width: 3 + 'em', height: 2.2+ 'em'}} className="btn btn-outline-dark dropdown-toggler" type="button" data-bs-toggle="dropdown">
                                <span style={{width: 3 + 'em', height: 2.2+ 'em'}} className="bi bi-person-lines-fill"></span>
                            </button>
                            <ul className="dropdown-menu dropdown-menu-end dropdown-menu-lg-star">
                                {cookieValue ? (
                                    <React.Fragment>
                                        <li><button onClick={() => { window.location.href=`/Profile/${userId}` }} className="dropdown-item">{userFullName}</button></li>
                                        <li><button onClick={handleLogout} className="dropdown-item">Logout</button></li>
                                    </React.Fragment>
                                ) : (
                                    <React.Fragment>
                                        <li><a className="dropdown-item" href="/Auth/Register">Register</a></li>
                                        <li><button onClick={handleLogin} className="dropdown-item">Login</button></li>
                                    </React.Fragment>                          
                                )}
                                <hr/>
                                <li><a className="dropdown-item" href="#">Host on Comfy Rental</a></li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        </nav>
    );
};
export default Navbar;
